ch pohledů, což výrazně zvyšuje výkon a snižuje zátěž serveru.\";s:32:\"installation:cache_symlink:label\";s:68:\"Používat symbolický odkaz na adresář simple cache (doporučeno)\";s:34:\"installation:cache_symlink:warning\";s:139:\"Symbolický odkaz byl vytvořen. Pokud z nějakého důvodu chcete odkaz odebrat, smažte adresář symbolického odkazu z vašeho serveru.\";s:32:\"installation:cache_symlink:paths\";s:79:\"Správně nastavený symbolický odkaz musí odkazovat z <i>%s</i> na <i>%s</i>\";s:32:\"installation:cache_symlink:error\";s:158:\"Díky nastavení vašeho serveru není možno vyrobit symbolický odkaz automaticky. Nahlédněte prosím do dokumentace a zřiďte symbolický odkaz ručně.\";s:31:\"installation:minify:description\";s:112:\"Simple cache také může zvýšit výkon kompresí JavaScript a CSS souborů (vyžaduje zapnutou simple cache).\";s:28:\"installation:minify_js:label\";s:36:\"Komprimovat JavaScript (doporučeno)\";s:29:\"installation:minify_css:label\";s:29:\"Komprimovat CSS (doporučeno)\";s:35:\"installation:htaccess:needs_upgrade\";s:158:\"Musíte aktualizovat soubor .htaccess tak, aby cesta byla vložena do GET parametru __elgg_uri (pro inspiraci můžete použít install/config/htaccess.dist).\";s:48:\"installation:htaccess:localhost:connectionfailed\";s:168:\"Elgg se nemůže připojit sám k sobě aby ověřil pravidla přepisu. Zkontrolujte že curl pracuje a nejsou žádná omezení IP bránící připojení z localhostu.\";s:36:\"installation:systemcache:description\";s:85:\"Systémová mezipaměť snižuje čas načítání Elgg ukládáním dat do souborů.\";s:30:\"installation:systemcache:label\";s:48:\"Používat systémovou mezipaněť (doporučeno)\";s:19:\"admin:legend:system\";s:7:\"Systém\";s:20:\"admin:legend:caching\";s:21:\"Vyrovnávací paměť\";s:27:\"admin:legend:content_access\";s:18:\"Přístup k obsahu\";s:24:\"admin:legend:site_access\";s:23:\"Přístup ke stránkám\";s:18:\"admin:legend:debug\";s:18:\"Ladění a výpisy\";s:9:\"upgrading\";s:14:\"Aktualizace...\";s:12:\"upgrade:core\";s:41:\"Va